import React,{useState,useEffect} from 'react'

export default function CatPictures() {
  const [cats, setCats]= useState([])

  useEffect(() => {
    fetch('/api/cats?limit=10	')
    .then(response => response.json())
    .then(setCats)
  },[])
  return (
    <>
    {cats.map(cat => (
      <img src={cat} alt='cat' className='cat-img'/>
    )
    )}

    </>
  )
}
